import React from 'react'
import {Link} from 'react-router-dom'

const Dropdown = ({isOpen, toggle }) => {
    return (
        <div className= {isOpen ? 'grid grid-rows-2 text-center items-center bg-yellow-50'
        : 'hidden'
    }
    onClick={toggle}
    >
            <Link className='p-4 uppercase' to='/'>Home</Link>
            <Link className='p-4 uppercase' to='/menu'>Menu</Link>
        </div>
    )
}

export default Dropdown;
